import logo from "./logo.svg";
import "./App.css";
import axios from "axios";
import { useEffect } from "react";
import { useState } from "react";
import Card from "@mui/material/Card";
import CardActions from "@mui/material/CardActions";
import CardContent from "@mui/material/CardContent";
import CardMedia from "@mui/material/CardMedia";
import Button from "@mui/material/Button";
import Typography from "@mui/material/Typography";
const hash = "c41cec366ac6c477f37e5a15e5717be2";

function App() {
  const [characters, setCharactersList] = useState("");
  console.log("cha:", characters);
  // const myArray = ["Jack", "Mary", "John", "Krish", "Navin"];
  const card = "haha";
  useEffect(() => {
    getCharacters();
  }, []);
  const getCharacters = () => {
    const url =
      "http://gateway.marvel.com/v1/public/characters?ts=100&apikey=57c07708bb14e463126483f2889b35eb&hash=c41cec366ac6c477f37e5a15e5717be2";

    axios
      .get(url)
      .then((response) => {
        console.log("haha response", response);
        console.log("characters", response.data.data.results);
        setCharactersList(response.data.data.results);
      })
      .catch((error) => {
        console.log("Error marvel: ", error);
      });
  };
  return (
    <div className="App">
      <header className="App-header">
        <h1>Heroes</h1>
        {/* {characters.map((characters) => (
          <h3>{characters.name}</h3>
        ))} */}
        <Card sx={{ maxWidth: 345 }}>
          <CardMedia
            component="img"
            height="140"
            image="/static/images/cards/contemplative-reptile.jpg"
            alt="green iguana"
          />
          <CardContent>
            <Typography gutterBottom variant="h5" component="div">
              Lizard
            </Typography>
            <Typography variant="body2" color="text.secondary">
              Lizards are a widespread group of squamate reptiles, with over
              6,000 species, ranging across all continents except Antarctica
            </Typography>
          </CardContent>
          <CardActions>
            <Button size="small">Share</Button>
            <Button size="small">Learn More</Button>
          </CardActions>
        </Card>
      </header>
    </div>
  );
}

export default App;
